# Arithmetic Operators
x = 10
y = 3
print(x + y)   # 13
print(x - y)   # 7
print(x * y)   # 30
print(x / y)   # 3.3333
print(x % y)   # 1
print(x ** y)  # 1000
print(x // y)  # 3

# Comparison Operators
print(x == y)  # False
print(x != y)  # True
print(x > y)   # True
print(x < y)   # False
print(x >= y)  # True
print(x <= y)  # False

# Logical Operators
a = True
b = False
print(a and b) # False
print(a or b)  # True
print(not a)   # False

# Bitwise Operators
print(x & y)   # 2
print(x | y)   # 11
print(x ^ y)   # 9
print(~x)      # -11
print(x << y)  # 80
print(x >> y)  # 1

# Assignment Operators
x = 10
x += 3
print(x)       # 13
x *= 2
print(x)       # 26

# Identity Operators
a = 10
b = 10
print(a is b)  # True
print(a is not b)  # False

# Membership Operators
list1 = [1, 2, 3, 4]
print(2 in list1)  # True
print(5 not in list1)  # True



